description:
Mighty GirlzMG - Jun 05, 2012 - Wenona   Mp4 + Pics



X's infiltration into Domina's lair seems to be foiled when she triggers the fuzz bomb alarms which render her unconscious. It seems her arrival has been anticipated and she took the bait hook, line and sinker. In her state of submission, she is mere putty in Domina's hands. Once restrained, she awakes to find herself in the most perilous of scenarios. Spread wide in the vortex throne, even her magnificent powers are no match for this trap. With her mask removed and her identity revealed, X is plied by her captor. And Domina's dark plan to sway X into joining her dark legion is carried out with brute force and precision


